import React from 'react';
import logo from './logo.svg';
import ART1 from './ART/1.jpg';
import ART2 from './ART/2.jpg';
import './App.css';
import './style.css';
import { FiInstagram } from 'react-icons/fi';
import { FiMail } from 'react-icons/fi';

function App() {
  return (
    <div className="App">
    <link rel="stylesheet" type="text/css" href="style.css" />
     <head>
        <link rel="stylesheet" type="text/css" href="style.css" />
		<title>
			TONY PADILLA
		</title>
	</head>
	<body bgcolor='hsl(212, 100%, 87%)'>
		<div className="myName">
			TONY PADILLA</div>
                <div className="info">
                        <br/>
                        <a href="https://www.instagram.com/tonypadilla.us/" target='_blank'><FiInstagram style={{ color: 'pink'}} /></a>     <a href="mailto:me@tonypadilla.us"><FiMail style={{color:'white'}} /></a>
                </div>
                <br />

        <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js"></script>
        <script src="modal.js"></script>
	</body>
    </div>
  );
}

export default App;
